            <pubDate>Mon, 13 Feb 2012 20:29:19 +0900</pubDate>
            <description><![CDATA[<p class="nico-thumbnail"><img alt="【Skyrim】カテジナvsシセロ カテジナさんが行く！番外編【ゆっくり実況】" src="http://tn-skr3.smilevideo.jp/smile?i=16959610" width="94" height="70" border="0"/></p><p class="nico-description">シセロファンの方は見ないほうがいいですｗ　というわけでみなさんお久しぶりです！（実は最終回からそんなに経っていませんが…）カテジナさんがスカイリムの地に帰ってまいりました。今回はガブリエラが残した記章の秘密をたどってシセロとともに洞窟探索です。最後までイライラさせるシセロにご期待ください！＊注意１．スカイリムの世界観を壊すおそれがあります。２．言うほどカテジナ要素はありません。３．実はアニメにはくわしくないです。闇の一党編マイリストmylist→mylist/29776641ゆっくりまとめコミュ→co1653398　ゆっくりPART1まとめ→mylist/32098741ブログ→http://ameblo.jp/katejinanico/</p><p class="nico-info"><small><strong class="nico-info-length">14:18</strong>｜<strong class="nico-info-date">2012年02月13日 20：27：46</strong> 投稿</small></p><p class="nico-numbers"><small>再生：<strong class="nico-numbers-view">17,453</strong>&nbsp;&#x20;コメント：<strong class="nico-numbers-res">588</strong>&nbsp;&#x20;マイリスト：<strong class="nico-numbers-mylist">85</strong></small></p>]]></description>
