            <description><![CDATA[<p class="nico-memo">最終話　ご視聴ありがとうございました！</p><p class="nico-thumbnail"><img alt="【Skyrim】デイドラの女王カテジナさんが行く！　最終話【ゆっくり実況】" src="http://tn-skr2.smilevideo.jp/smile?i=16862969" width="94" height="70" border="0"/></p><p class="nico-description">最終回です。グロ注意！　アサシン動画らしく最後はカッコよくきめたいと思い、ちょっとだけがんばりましたｗ今まで見てくださったみなさん、本当にありがとうございました！またの機会にお会いしましょう！　ジークジオン！＊注意１．スカイリムの世界観を壊すおそれがあります。２．言うほどカテジナ要素はありません。３．実はアニメにはくわしくないです。前回→sm16830111スカイリムmylist→mylist/29776641ゆっくりまとめコミュ→co1653398　ゆっくりPART1まとめ→mylist/32098741ブログ→http://ameblo.jp/katejinanico/</p><p class="nico-info"><small><strong class="nico-info-length">23:39</strong>｜<strong class="nico-info-date">2012年02月03日 10：18：44</strong> 投稿</small></p><p class="nico-numbers"><small>再生：<strong class="nico-numbers-view">34,441</strong>&nbsp;&#x20;コメント：<strong class="nico-numbers-res">1,302</strong>&nbsp;&#x20;マイリスト：<strong class="nico-numbers-mylist">178</strong></small></p>]]></description>
