            <description><![CDATA[<p class="nico-memo">第７話　とうとう皇帝暗殺へと向かうカテジナさん！</p><p class="nico-thumbnail"><img alt="【Skyrim】デイドラの女王カテジナさんが行く！　その７【ゆっくり実況】" src="http://tn-skr4.smilevideo.jp/smile?i=16830111" width="94" height="70" border="0"/></p><p class="nico-description">とうとう皇帝暗殺へと赴くカテジナ！　　今回からシリアスモードです。笑いの要素は少ないですが、ぜひ最後までストーリーを楽しんでくださいね！＊｢パ｣－サーナックスに直しました！コメントありがとうございました。＊注意１．スカイリムの世界観を壊すおそれがあります。２．言うほどカテジナ要素はありません。３．実はアニメにはくわしくないです。前回→sm16770454次回→sm16862969スカイリムmylist→mylist/29776641ゆっくりまとめコミュ→co1653398　ゆっくりPART1まとめ→mylist/32098741ブログ→http://ameblo.jp/katejinanico/</p><p class="nico-info"><small><strong class="nico-info-length">18:34</strong>｜<strong class="nico-info-date">2012年01月30日 11：23：31</strong> 投稿</small></p><p class="nico-numbers"><small>再生：<strong class="nico-numbers-view">30,453</strong>&nbsp;&#x20;コメント：<strong class="nico-numbers-res">981</strong>&nbsp;&#x20;マイリスト：<strong class="nico-numbers-mylist">118</strong></small></p>]]></description>
