            <pubDate>Fri, 03 Feb 2012 01:16:26 +0900</pubDate>
            <description><![CDATA[<p class="nico-memo">第４話　シセロ爆発！　そしてクロノクル登場！</p><p class="nico-thumbnail"><img alt="【Skyrim】デイドラの女王カテジナさんが行く！　その４【ゆっくり実況】" src="http://tn-skr3.smilevideo.jp/smile?i=16651794" width="94" height="70" border="0"/></p><p class="nico-description">第１話の10000回再生ありがとうございました。新キャラクターともども、これからもよろしくです。ストーリーがかなり盛り上がってきました。まさか「あの人を殺る」なんていう依頼が舞い込んでくるとは…今後どうなる闇の一党？　そしてカテジナは？＊注意１．スカイリムの世界観を壊すおそれがあります。２．言うほどカテジナ要素はありません。３．実はアニメにはくわしくないです。オープニングをちょこっと変えましたが、たぶん次回からはまた元に戻りますｗ前回→sm16634040次回→sm16709796スカイリムmylist→mylist/29776641ゆっくりまとめコミュ→co1653398　ゆっくりPART1まとめ→mylist/32098741ブログ→http://ameblo.jp/katejinanico/</p><p class="nico-info"><small><strong class="nico-info-length">17:14</strong>｜<strong class="nico-info-date">2012年01月09日 16：41：05</strong> 投稿</small></p><p class="nico-numbers"><small>再生：<strong class="nico-numbers-view">34,806</strong>&nbsp;&#x20;コメント：<strong class="nico-numbers-res">928</strong>&nbsp;&#x20;マイリスト：<strong class="nico-numbers-mylist">150</strong></small></p>]]></description>
