            <description><![CDATA[<p class="nico-memo">第３話　ここからカテジナさんだけではキツいと判断</p><p class="nico-thumbnail"><img alt="【Skyrim】デイドラの女王カテジナさんが行く！　その３【ゆっくり実況】" src="http://tn-skr1.smilevideo.jp/smile?i=16634040" width="94" height="70" border="0"/></p><p class="nico-description">キャラ崩壊してるぜヒャッハー　　皆様からのありがたいコメントはちょくちょく動画に反映していきたいと思います。べ、べつにネタがなくなってきたからパクらせてもらうわけじゃないんだからね！＊注意１．スカイリムの世界観を壊すおそれがあります。２．言うほどカテジナ要素はありません。３．実はアニメにはくわしくないです。撮影は順調！　何とか今週中のアップに漕ぎつけました。次回作はストーリーが大きく展開します、たぶん。前回→sm16596646次回→sm16651794スカイリムmylist→mylist/29776641ゆっくりまとめコミュ→co1653398　ゆっくりPART1まとめ→mylist/32098741ブログ→http://ameblo.jp/katejinanico/</p><p class="nico-info"><small><strong class="nico-info-length">16:26</strong>｜<strong class="nico-info-date">2012年01月07日 20：16：00</strong> 投稿</small></p><p class="nico-numbers"><small>再生：<strong class="nico-numbers-view">36,486</strong>&nbsp;&#x20;コメント：<strong class="nico-numbers-res">710</strong>&nbsp;&#x20;マイリスト：<strong class="nico-numbers-mylist">162</strong></small></p>]]></description>
